const jestConfig = require('eslint-plugin-jest')
module.exports = {
  root: true,
  env: {
    node: true
  },
  parserOptions: {
    parser: '@babel/eslint-parser',
    requireConfigFile: false
  },
  extends: [
    'plugin:vue/recommended',
    'standard'
  ],
  plugins: [],
  rules: {},
  overrides: [
    Object.assign({}, jestConfig.configs.recommended, {
      files: ['packages/**/*.spec.js', 'packages/**/test/**/*.js'],
      globals: jestConfig.environments.globals.globals,
      env: {
        es6: true,
        node: true
      },
      rules: {
        'eslint-disable-next-line': 'off'
      }
    })
  ]
}

module.exports = {
  presets: [
    ['@babel/preset-env', {
      modules: false
    }]
  ],
  plugins: [
    '@babel/plugin-proposal-object-rest-spread',
    '@babel/plugin-proposal-nullish-coalescing-operator'
  ],
  comments: false,
  env: {
    test: {
      presets: [
        ['@babel/preset-env']
      ],
      plugins: ['@babel/plugin-transform-runtime']
    }
  }
}

const path = require('path')
const dir = (p) => path.resolve(__dirname, p)

module.exports = {
  rootDir: '.',
  transform: {
    '^.+\\.js$': ['babel-jest', { cwd: __dirname }]
  },
  snapshotSerializers: [
    dir('node_modules/jest-serializer-vue')
  ],
  testEnvironment: 'jsdom'
}

const base = require('./jest.base')

module.exports = {
  ...base,
  rootDir: './',
  projects: ['<rootDir>/packages/*'],
  testURL: 'http://localhost/'
}

import terser from '@rollup/plugin-terser'
import resolve from '@rollup/plugin-node-resolve'
import commonjs from '@rollup/plugin-commonjs'
import { babel } from '@rollup/plugin-babel'
import copy from 'rollup-plugin-copy'

export function generateOutputConfig (fileName = 'index', opts) {
  return {
    mjs: {
      file: `dist/${fileName}.mjs`,
      format: 'es',
      ...opts,
    },
    cjs: {
      file: `dist/${fileName}.cjs`,
      format: 'cjs',
      ...opts,
    },
    global: {
      file: `dist/${fileName}.iife.min.js`,
      format: 'iife',
      ...opts,
    }
  }
}

function generateConfigFactory({
  libraryName,
  input = 'src/index.js',
  outputConfigs,
  copyTypes = false
}) {
  /**
   * @type {import('rollup').RollupOptions}
   */
  const config = {
    input,
    external: ['vue-demi'],
    plugins: [resolve(), commonjs(), babel({ babelHelpers: 'bundled' })],
    output: []
  }

  /**
   * Create config output
   * @param {string} name
   * @param {import('rollup').OutputOptions} options
   * @return {*}
   */
  function createConfig (name, options) {
    const opts = { ...options }
    opts.exports = 'named'
    opts.globals = {
      ...opts.globals,
      'vue-demi': 'VueDemi'
    }

    const isGlobalBuild = name === 'global'
    const isMinified = opts.file.includes('.min.')

    if (isGlobalBuild) opts.name = libraryName
    opts.plugins = []
    if (isMinified) {
      opts.plugins.push(
        terser()
      )
    }
    if (copyTypes) {
      opts.plugins.push(
        copy({
          hook: 'writeBundle',
          flatten: true,
          targets: [
            {
              src: 'index.d.ts',
              dest: 'dist',
              rename: 'index.d.cts'
            },
            {
              src: 'index.d.ts',
              dest: 'dist',
              rename: 'index.d.mts'
            }
          ]
        })
      )
    }
    return opts
  }

  const packageBuilds = Object.keys(outputConfigs)
  config.output = packageBuilds.map(buildName => createConfig(buildName, outputConfigs[buildName]))

  return config
}

export { generateConfigFactory }
